import React from 'react';
import { Link } from 'react-router-dom';

const NewTaskPage = () => {
  return (
    <>
    <nav>
        <Link to="/">Home</Link>
      </nav>

    <div className="new-task-page">
      <h2>Add New Task</h2>
      <form>
        <label>
          Title:
          <input type="text" name="title" />
        </label>
        <label>
          Description:
          <textarea name="description" />
        </label>
        <button type="submit">Add Task</button>
      </form>
    </div>
    </>
  );
};

export default NewTaskPage;
